import './TodoApp.css'
import { useState } from 'react'
import {BrowserRouter, Routes, Route, useNavigate, useParams, Link} from 'react-router-dom'
import LogoutComponent from './LogoutComponent'
import FooterComponent from './FooterComponent'
import HeaderComponent from './HeaderComponent'
export default function TodoApp(){
    return (
        <div className="TodoApp">


            <BrowserRouter>
            <HeaderComponent/>
                <Routes>
                    <Route path='/' element = {<LoginComponent/>}/>
                    <Route path='/login' element = {<LoginComponent/>}/>
                    <Route path='/welcome/:username' element = {<WelcomeComponent/>}/>
                    <Route path='/todos' element = {<ListTodosComponent/>}/>
                    <Route path='/logout' element = {<LogoutComponent/>}/>
                    <Route path='*' element = {<ErrorComponent/>}/>
                </Routes>
            <FooterComponent/>
            </BrowserRouter>


        </div>
    )
}

function LoginComponent() {
    const [username, setUsername] = useState('in28minutes')
    const [password, setPassword] = useState('dummy')
    const [showSuccessMessage, setshowSuccessMessage] = useState(false)
    const [showErrorMessage, setshowErrorMessage] = useState(false)
    const navigate = useNavigate();
    function handleUsernameChange(event){
        // console.log(event.target.value);
        setUsername(event.target.value)
    }
    function handlePasswordChange(event){
        // console.log(event.target.value);
        setPassword(event.target.value)
    }
    function handleSubmit(){
        // console.log(username);
        // console.log(password);
        if (username ==='in28minutes' && password ==='dummy'){
            // console.log('Success')
            setshowSuccessMessage(true)
            setshowErrorMessage(false)
            // navigate('/welcome/in28minutes')
            navigate(`/welcome/${username}`)


        } else{
            // console.log('Fail')
            setshowSuccessMessage(false)
            setshowErrorMessage(true)
        }

    }


    return (
        <div className="Login">
            <h1>Time to Login</h1>
            {/* <SuccessMessageComponent/>
            <FailureMessageComponent/> */}
            {showSuccessMessage && <div className='successMessage'>Authentication Successfull</div>}
            {showErrorMessage && <div className='errorMessage'>Authentication Failed</div>}
            <div className="LoginForm">
                <div>
                    <label>User Name</label>
                    <input type="text" name ="username" value={username} onChange = {handleUsernameChange}/>
                </div>
                <div>
                    <label>Password</label>
                    <input type="password" name ="password" value={password} onChange = {handlePasswordChange} />
                </div>
                <div>
                <button type="button" name ="login" onClick={handleSubmit}>login </button>
                </div>
            </div>
        </div>
    )
}



function WelcomeComponent() {
    const {username} = useParams()
    console.log(username)
    return (
        <div className='WelcomeComponent'>
            <h1> Welcome {username}</h1>
            <div className="Welcome">
                Manage your todos - <Link to ="/todos">Go here</Link>
            </div>
        </div>

    )
}

function ErrorComponent() {
    return (
        <div className="ErrorComponent">
           <h1>We are working hard</h1> 
           <div>
               Apologies for the 404.
           </div>
        </div>
    )
}







function ListTodosComponent() {

    const today = new Date();
    const targetDate = new Date(today.getFullYear()+12, today.getMonth(), today.getDay())

    const todos = [{id:1, description: 'Learn AWS', done: false, targetDate: targetDate},
                    {id:2, description: 'Learn Docker', done: false, targetDate: targetDate},
                    {id:3, description: 'Learn GCP', done: false, targetDate: targetDate},
                    ]
    return (
        <div className="conainer">
           <h1>Things you want to do</h1> 
           <div>
               <table className='table'>
                   <thead>
                       <tr>
                           <td>Id</td>
                           <td>Description</td>
                           <td>Is Done?</td>
                           <td>Target Date</td>
                       </tr>
                   </thead>
                   <tbody>
                      {
                          todos.map(
                              todo => (
                                  <tr key = {todo.id}>
                                      <td>{todo.id}</td>
                                      <td>{todo.description}</td>
                                      <td>{todo.done.toString()}</td>
                                      <td>{todo.targetDate.toDateString()}</td>
                                  </tr>
                              )
                          )
                      }
                   </tbody>
               </table>
           </div>
        </div>
    )
}
